met Steven Seagal, Anthony 'Treach' Criss en Lawrence Turner

Harlen Banks is een professionele dief die wil stoppen met zijn criminele loopbaan. Zijn eerste baantje als chauffeur van een 
geldtransport draait gelijk uit op een ramp, als zijn opdrachtgever Max Stevens hem belazerd blijkt te hebben. Hij belandt in de 
gevangenis want het bleek een waarde-tranport van 20 miljoen dollar te zijn. Dankzij een vriend weet hij te ontsnappen. Samen 
gaan zij dan op zoek naar degenen die verantwoordelijk waren voor zijn detentie. Bovendien blijkt de 20 miljoen dollar volledig 
zoek te zijn geraakt..
